import React from 'react';

const Sources = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'Left',
        alignItems: 'Left',
        height: '100vh',
        paddingLeft: 20
      }}
    >

      <body>
        <header>
          <h4>Sources</h4>
        </header>
      <p>Castañón, J. (2019, May 1). 10 machine learning methods that every data scientist should know. Towards Data Science. Retrieved November 14, 2022, from https://towardsdatascience.com/10-machine-learning-methods-that-every-data-scientist-should-know-3cc96e0eeee9</p>

      <p>Macrotrends LLC. (2022). Apple - 42 year stock price history: AAPL. Macrotrends. Retrieved October 5, 2022, from https://www.macrotrends.net/stocks/charts/AAPL/apple/stock-price-history</p>

      <p>Meeratif. (2022, September 30). Apple Stock Price Analysis. Kaggle. Retrieved October 5, 2022, from https://www.kaggle.com/code/meeratif/apple-stock-price-analysis?scriptVersionId=106865302</p>
      </body>
    </div>
  );
};

export default Sources;
